// utils/generatePayslipHTML.ts
export type PayslipPayload = {
  companyName?: string;
  companyAddress?: string;
  month: string;           // "August 2025"
  date?: string;
  employeeId: string;
  name: string;
  designation?: string;
  department?: string;

  grossWages: number;
  totalWorkingDays: number;
  lopDays: number;
  leavesTaken: number;

  basic: number;
  hra: number;
  conveyance: number;
  medical: number;
  attendanceIncentive: number;
  festivalBonus: number;
  otherAllowance: number;

  epf: number;
  esi: number;
  professionalTax: number;
  welfareFund: number;
  insurance: number;
  advance: number;

  totalEarnings?: number;
  totalDeductions?: number;
  netSalary?: number;
};

function escapeHtml(s: any) {
  if (s === undefined || s === null) return "";
  return String(s)
    .replace(/&/g, "&amp;")
    .replace(/</g, "&lt;")
    .replace(/>/g, "&gt;")
    .replace(/"/g, "&quot;");
}

function fmt(n: number | undefined | null) {
  const num = Number(n || 0);
  return num.toLocaleString("en-IN", { minimumFractionDigits: 2, maximumFractionDigits: 2 });
}

export default function generatePayslipHTML(p: PayslipPayload): string {
  const totalEarnings =
    Number(p.totalEarnings ??
      (p.basic + p.hra + p.conveyance + p.medical + p.attendanceIncentive + p.festivalBonus + p.otherAllowance)
    );
  const totalDeductions =
    Number(p.totalDeductions ??
      (p.epf + p.esi + p.professionalTax + p.welfareFund + p.insurance + p.advance)
    );
  const net = Number(p.netSalary ?? (totalEarnings - totalDeductions));
  const paidLeaves = Number((p.totalWorkingDays || 0) - (p.leavesTaken || 0));

  const primaryPink = "#c94b66";
  const lightPinkBg = "#f6e9eb";
  const textGray = "#4b5563";

 const html = `<!doctype html>
<html>
<head>
<meta charset="utf-8" />
<meta name="viewport" content="width=device-width,initial-scale=1" />
<title>Payslip - ${escapeHtml(p.name)}</title>
<style>
  @page { size: A4; margin: 18mm; }
  body {
    font-family: Arial, sans-serif;
    color: #374151;
    margin: 0; padding: 0;
    -webkit-print-color-adjust: exact;
  }
  .sheet {
    width: 100%;
    padding: 0;
    box-sizing: border-box;
    position: relative;
  }
  .card {
    background: #fff;
    border-radius: 8px;
    overflow: hidden;
    position: relative;
    min-height: 100%;
  }
  .watermark {
    position: absolute;
    left: 50%; top: 50%;
    transform: translate(-50%, -50%);
    opacity: 0.06;
    width: 65%;
    z-index: 0;
  }
  .header {
    display: flex;
    align-items: center;
    justify-content: space-between;
    padding: 16px 20px;
    border-bottom: 2px solid #f1f1f1;
    z-index: 2;
    position: relative;
  }
  .brand { display: flex; align-items: center; gap: 10px; }
  .logo { height: 40px; object-fit: contain; }
  .company { font-weight: bold; font-size: 16px; color: #e91e63; }
  .paymonth { text-align: right; color: #e91e63; font-weight: bold; font-size: 14px; }
  .emp-block {
    background: #fff5f8;
    padding: 14px 20px;
    position: relative;
    z-index: 2;
  }
  .emp-title { font-weight: bold; color: #374151; margin-bottom: 8px; }
  .emp-row { font-size: 13px; margin: 3px 0; }
  .table { width: 100%; border-collapse: collapse; margin-top: 14px; }
  .table th, .table td {
    padding: 6px 10px;
    border-bottom: 1px solid #ececec;
  }
  .table th {
    background: #fff;
    color: #e91e63;
    font-weight: bold;
    text-align: left;
  }
    .table th:last-child {
  text-align: right;
}

  .right { text-align: right; }
  .cols { display: flex; gap: 14px; margin-top: 14px; }
  .col { flex: 1; }
  .section-title {
    color: #e91e63;
    font-weight: bold;
    padding-bottom: 4px;
    border-bottom: 2px solid #e91e63;
    margin-bottom: 6px;
    display: inline-block;
  }
  .grid {
    width: 100%;
    border-collapse: collapse;
  }
  .grid td {
    padding: 4px 6px;
    border-bottom: 1px solid #f1f1f1;
    font-size: 13px;
  }
  .totals-row {
    display: flex;
    justify-content: space-between;
    align-items: center;
    padding-top: 10px;
    border-top: 2px solid #eaeaea;
    font-weight: bold;
  }
  .net-box {
    background: #e91e63;
    color: #fff;
    padding: 6px 12px;
    border-radius: 4px;
    font-weight: bold;
    font-size: 14px;
  }
  .footer {
    text-align: center;
    font-size: 11px;
    color: #6b7280;
    padding: 14px 20px;
    position: relative;
    z-index: 2;
  }
</style>
</head>
<body>
  <div class="sheet">
    <div class="card">
      <img class="watermark" src="data:image/png;base64," alt="watermark" />
      <div class="header">
        <div class="brand">
          <img class="logo" src="data:image/png;base64," alt="logo" />
        </div>
        <div class="paymonth">
          <div style="font-size:12px;color:#6b7280;">Pay Slip For</div>
          <div style="font-size:16px; margin-top:4px;">${escapeHtml(p.month)}</div>
        </div>
      </div>

      <div class="emp-block">
        <div class="emp-title">Employee Information</div>
        <div class="emp-row"><strong>Employee ID:</strong> ${escapeHtml(p.employeeId)}</div>
        <div class="emp-row"><strong>Employee Name:</strong> ${escapeHtml(p.name)}</div>
        <div class="emp-row"><strong>Designation:</strong> ${escapeHtml(p.designation || "-")}</div>
        <div class="emp-row"><strong>Department:</strong> ${escapeHtml(p.department || "-")}</div>
      </div>

      <div style="padding: 14px 20px;">
        <table class="table">
          <tr><th>Sl No</th><th>Description</th><th class="right">Amount</th></tr>
          <tr><td>1.</td><td>Gross Wages</td><td class="right">₹ ${fmt(p.grossWages)}</td></tr>
          <tr><td>2.</td><td>Total Working Days</td><td class="right">${p.totalWorkingDays}</td></tr>
          <tr><td>3.</td><td>LOP Days</td><td class="right">${p.lopDays}</td></tr>
          <tr><td>4.</td><td>Leaves Taken</td><td class="right">${p.leavesTaken}</td></tr>
          <tr><td>5.</td><td>Paid Days</td><td class="right">${paidLeaves}</td></tr>
        </table>

        <div class="cols">
          <div class="col">
            <div class="section-title">Earnings</div>
            <table class="grid">
              <tr><td>Basic</td><td class="right">₹ ${fmt(p.basic)}</td></tr>
              <tr><td>HRA</td><td class="right">₹ ${fmt(p.hra)}</td></tr>
              <tr><td>Conveyance Allowance</td><td class="right">₹ ${fmt(p.conveyance)}</td></tr>
              <tr><td>Medical Allowance</td><td class="right">₹ ${fmt(p.medical)}</td></tr>
              <tr><td>Attendance Incentive</td><td class="right">₹ ${fmt(p.attendanceIncentive)}</td></tr>
              <tr><td>Festival Bonus</td><td class="right">₹ ${fmt(p.festivalBonus)}</td></tr>
              <tr><td>Other Allowance</td><td class="right">₹ ${fmt(p.otherAllowance)}</td></tr>
              <tr style="font-weight:bold;"><td>[A] Total Earnings</td><td class="right">₹ ${fmt(totalEarnings)}</td></tr>
            </table>
          </div>

          <div class="col">
            <div class="section-title">Deductions</div>
            <table class="grid">
              <tr><td>EPF</td><td class="right">₹ ${fmt(p.epf)}</td></tr>
              <tr><td>ESI</td><td class="right">₹ ${fmt(p.esi)}</td></tr>
              <tr><td>Professional Tax</td><td class="right">₹ ${fmt(p.professionalTax)}</td></tr>
              <tr><td>Welfare Fund</td><td class="right">₹ ${fmt(p.welfareFund)}</td></tr>
              <tr><td>Insurance</td><td class="right">₹ ${fmt(p.insurance)}</td></tr>
              <tr><td>Advance</td><td class="right">₹ ${fmt(p.advance)}</td></tr>
              <tr style="font-weight:bold;"><td>[B] Total Deductions</td><td class="right">₹ ${fmt(totalDeductions)}</td></tr>
            </table>
          </div>
        </div>

        <div class="totals-row">
          <div>[A] - [B] = Net Salary</div>
          <div><span class="net-box">₹ ${fmt(net)}</span></div>
        </div>
      </div>

      <div class="footer">This is a system generated payslip. For queries contact HR.</div>
    </div>
  </div>
</body>
</html>`;



  return html;
}
